        def makePairs(arr):
            pairs = []
            for i in range(len(arr)):
                if i < len(arr) - 1:
                    temp = (arr[i], arr[i + 1])
                    pairs.append(temp)
            return pairs

        def generate(cfd, word='the', num=random.randint(1, 30)):
            my_words_list = []
            for i in range(num):

                arr = []
                for j in cfd[word]:
                    for k in range(cfd[word][j]):
                        arr.append(j)

                word = arr[int((len(arr)) * random.random())]

                my_words_list.append(word)
            str1 = ' '.join(my_words_list)

            return (str1)

        pairs = makePairs(walden)
        cfd = nltk.ConditionalFreqDist(pairs)


        def makeText(fileName, word='the', num=random.randint(1, 11)):
            file = open(fileName, 'r', encoding="utf8")
            string = file.read()
            stringArr = string.split()

            pairs = makePairs(stringArr)
            model = nltk.ConditionalFreqDist(pairs)
            generate(model, word, num)

        self.text=generate(cfd)


